import React from "react";

class Button extends React.Component {
  render() {
    var array = new Array(100);
    for (var i = 1; i <= 100; i++) {
      array.push(i);
    }
    const buttonLoop = array.map((number) => {
      return (
        <button key={number} className={"button"}>
          {number}
        </button>
      );
    });
    return <div className="button-container">{buttonLoop}</div>;
  }
}

export default Button;
